import { List, Typography } from 'antd';

const { Text } = Typography;

function NavMenu() {

  const menu = [
    {
      title: 'Thực đơn',
      url: '/thuc-don',
    },
    {
      title: 'Sảnh tiệc',
      url: '/sanh-tiec',
      children: [
        {
          title: 'Thuyển rồng Kim Long - Hoàng Long',
          url: '/thuyen-rong-kim-long-hoang-long',
        },
        {
          title: 'Sảnh Ngân Sen',
          url: '/sanh-ngan-sen',
        },
        {
          title: 'Sảnh Hoàng Sen - Kim Sen',
          url: 'sanh-hoang-sen-kim-sen',
        },
        {
          title: 'Sảnh Thanh Sen',
          url: 'sanh-thanh-sen',
        },
      ],
    },
    {
      title: 'Phòng hội nghị',
      url: '/phong-hoi-nghi',
    },
    {
      title: 'Khuyến mãi tiệc cưới',
      url: '/khuyen-mai-tiec-cuoi',
    },
  ];
  return (<>
    <List
      grid={{ gutter: 16, column: 4 }}
      dataSource={menu}
      renderItem={(item) => (
        <List.Item>
          <Text>{item.title}</Text>
        </List.Item>
      )}
    />
  </>);
}
export default NavMenu;
